import React from "react";

const Movie = ({ title }) => {
  return (
    <div>
      movies
      {title}
      <img src="https://image.tmdb.org/t/p/w500/6RGiA5BfhelU9zoD0b1GAG4GWWf.jpg" />
    </div>
  );
};

export default Movie;
